import Chart from "react-google-charts";
import '../Styles/articles.scss';
import csvFile from '../INR.csv'
const Papa = require('papaparse');

class SchemaPage extends Component {

  constructor(props) {
    super(props)
    this.state = {
      csv: {},
    }
  }

  async componentWillMount() {
      await this.loadCsv()
      console.log(this.csv)
  }

  async loadCsv() {
